import React, { useEffect, useReducer } from "react";
import { Context, ContextProvider } from "./app/context/Context";
import HomeScreen from "./app/screens/HomeScreen";

export default function App() {
  const { city, getCity } = useReducer(Context);
  useEffect(() => {
    console.log(city);
    eff(city);
  }, [city]);

  const eff = (city) => {
    getCity(city);
    console.log("effect");
  };

  return (
    <ContextProvider>
      <HomeScreen />
    </ContextProvider>
  );
}
